B I G NEWS!!!✨🤩 I am beyond excited to announce that my school is opening a Prep Kangaroos class (an additional Mon & Tues class) from the beginning of Term 3!

You have allllll been asking for the longest time to see what Prep is *really* like. I am so unbelievably excited to show you how incredible it is! As the Dean of Junior Primary and teaching the Monday-Wednesday (Koalas) Prep class I may be slightly biased. I created this video for the lovely place in which I work to allow you to have a proper glimpse into our exciting Prep programme that aims to begin our students’ schooling journey exactly as it should: encouraging children to WANT to learn.

{For those in our area, apply NOW to reserve a place for your child at the Macarthur region's leading Christian Independent Preparatory School. Application link via bio at @st_petersanglican @invite_to_learn or at https://www.stpeters.nsw.edu.au/admissions/how-to-apply/ (Note: children on the existing waiting list receive first preference.)}

#rubegoldberg machine! Has your child ever made one? Have you? Henry made his for school as part of his remote learning. Yes, his bedroom is messy. This is what happens when a child spends all their spare time focused on something for a few days.🤷‍♀️ BUT all they are learning during this experience is far more important and he cleaned everything up afterwards.😊 It’s fun watching #rubegoldbergmachine videos online and doing this is helpful before attempting your own. Basically it’s a long way of doing something simple- in this case it was closing a book. It was nail biting to the end!!! Who wants to have a go??! ❤️ Jen @living_future_memories @where_heart_meets_home 

{Dominoes were a mix from Amazon and @smiggle_ and the marble run is from @thecreativetoyshop ✨ The marble run lives in Henry’s bedroom and he often sets it up along his bookshelves and onto the floor. Great for children like him obsessed with all things #stem 🎉 Book is @officialblueytv and the orange car track I think may be matchbox or hot wheels cars.}

